import React from 'react';
import './Header.css';

const Header = () => {
  return (
    <header className="header">
      <h1 className="logo">Growe</h1>
      <nav className="nav">
        <img
          src="/img/설정이미지.png"
          alt="메뉴 버튼"
          className="menu-icon"
          onClick={() => alert("메뉴 열기!")}
        />
        <button className="login-button">로그인</button>
      </nav>
    </header>
  );
};

export default Header;
